import React, {Component} from 'react';

class FrontPage extends Component {
  render(){
    return (
      <div>
        <div id="bg">
          <img src={require('./imgs/star_background.jpg')}/>
        </div>
        <div>
          <h1 style={{backgroundColor:"transparent"}}>Hey I'm Connor!</h1>
        </div>
      </div>
     );
  }

}

export default FrontPage;
